function CurrDate(){
const current = new Date();
const m = (2022, 13, 1);;
const longmonth = m.toLocaleString('en-us', { month: 'long' });
const day = current.getDate().toLocaleString('en-US', {day: '2-digit'});
const year = current.getFullYear();


return(
<div>
    <div className='box'>
        <div className='date_box'>
            <div>{longmonth}-{day}-{year}</div> 
                       
        </div>
    </div> 
</div>);
}

export default CurrDate;
